import React, { useState } from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import bannerImage from '../assets/images/purpleBanner.png';
import '../assets/fonts/Poppins-Regular.ttf';
import '../assets/fonts/Quicksand-Regular.ttf';

const Contact = () => {
    const [formData, setFormData] = useState({
        firstName: '',
        lastName: '',
        email: '',
        topic: '',
        message: '',
    });
    const [errors, setErrors] = useState({});
    const [isDropdownOpen, setIsDropdownOpen] = useState(false);
    const [hoveredOption, setHoveredOption] = useState(null);

    const dropdownOptions = [
        'Collaborations',
        'Business Partnerships',
        'Sponsorship',
        'Join the Team',
        'Start a Chapter',
        'Other',
    ];

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData((prevData) => ({
            ...prevData,
            [name]: value,
        }));
        setErrors((prevErrors) => ({
            ...prevErrors,
            [name]: '', // Clear error for this field
        }));
    };

    const handleDropdownSelect = (option) => {
        setFormData((prevData) => ({ ...prevData, topic: option }));
        setIsDropdownOpen(false); // Close dropdown after selecting
        setErrors((prevErrors) => ({
            ...prevErrors,
            topic: '', // Clear error for topic
        }));
    };

    const validateEmail = (email) => {
        const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
        return emailRegex.test(email);
    };

    const validateForm = () => {
        const newErrors = {};

        if (!formData.firstName.trim()) {
            newErrors.firstName = 'First Name is required.';
        }
        if (!formData.lastName.trim()) {
            newErrors.lastName = 'Last Name is required.';
        }
        if (!formData.email.trim()) {
            newErrors.email = 'Email is required.';
        } else if (!validateEmail(formData.email)) {
            newErrors.email = 'Please enter a valid email address.';
        }
        if (!formData.topic.trim()) {
            newErrors.topic = 'Please select a topic.';
        }
        if (!formData.message.trim()) {
            newErrors.message = 'Message is required.';
        }

        setErrors(newErrors);

        return Object.keys(newErrors).length === 0; // Return true if no errors
    };

    const handleSubmit = () => {
        if (validateForm()) {
            console.log('Form Data Submitted:', formData);
            alert('Form submitted successfully!');
        }
    };

    return (
        <div>
            <Header />

            {/* Banner Section */}
            <div style={styles.banner}>
                <h1 style={styles.bannerText}>Contact</h1>
            </div>

            {/* Main Content Section */}
            <div style={styles.contentSection}>
                <h2 style={styles.title}>Get in Touch with Us!</h2>
                <p style={styles.text}>
                    Have any questions or need assistance? We’re here to help. Fill out the form below, and we’ll get back to you as soon as possible.
                </p>

                {/* Contact Form */}
                <div style={styles.formContainer}>
                    {/* First Name */}
                    <div style={styles.inputGroup}>
                        <label style={styles.label}>First Name</label>
                        <input
                            type="text"
                            name="firstName"
                            value={formData.firstName}
                            onChange={handleInputChange}
                            placeholder="Enter First Name"
                            style={styles.inputBox}
                        />
                        {errors.firstName && <div style={styles.errorText}>{errors.firstName}</div>}
                    </div>

                    {/* Last Name */}
                    <div style={styles.inputGroup}>
                        <label style={styles.label}>Last Name</label>
                        <input
                            type="text"
                            name="lastName"
                            value={formData.lastName}
                            onChange={handleInputChange}
                            placeholder="Enter Last Name"
                            style={styles.inputBox}
                        />
                        {errors.lastName && <div style={styles.errorText}>{errors.lastName}</div>}
                    </div>

                    {/* Email */}
                    <div style={styles.inputGroup}>
                        <label style={styles.label}>Email</label>
                        <input
                            type="email"
                            name="email"
                            value={formData.email}
                            onChange={handleInputChange}
                            placeholder="Enter Email"
                            style={styles.inputBox}
                        />
                        {errors.email && <div style={styles.errorText}>{errors.email}</div>}
                    </div>

                    {/* Topic (Dropdown) */}
                    <div style={styles.inputGroup}>
                        <label style={styles.label}>Topic</label>
                        <div
                            style={styles.dropdownContainer}
                            onClick={() => setIsDropdownOpen(!isDropdownOpen)}
                        >
                            <div style={styles.dropdownSelected}>
                                {formData.topic || 'Select Topic'}
                            </div>
                            {isDropdownOpen && (
                                <div style={styles.dropdownMenu}>
                                    {dropdownOptions.map((option) => (
                                        <div
                                            key={option}
                                            style={{
                                                ...styles.dropdownOption,
                                                ...(hoveredOption === option
                                                    ? styles.dropdownOptionHover
                                                    : {}),
                                            }}
                                            onMouseEnter={() => setHoveredOption(option)}
                                            onMouseLeave={() => setHoveredOption(null)}
                                            onClick={() => handleDropdownSelect(option)}
                                        >
                                            {option}
                                        </div>
                                    ))}
                                </div>
                            )}
                        </div>
                        {errors.topic && <div style={styles.errorText}>{errors.topic}</div>}
                    </div>

                    {/* Message */}
                    <div style={styles.inputGroup}>
                        <label style={styles.label}>Message</label>
                        <textarea
                            name="message"
                            value={formData.message}
                            onChange={handleInputChange}
                            placeholder="Enter Message"
                            style={styles.textareaBox}
                        />
                        {errors.message && <div style={styles.errorText}>{errors.message}</div>}
                    </div>

                    {/* Submit Button */}
                    <div style={styles.submitButton} onClick={handleSubmit}>
                        <span style={styles.submitText}>Submit</span>
                    </div>
                </div>
            </div>

            <Footer />
        </div>
    );
};

const styles = {
    //... (previous styles)
    errorText: {
        color: 'red',
        fontSize: '14px',
        fontFamily: 'Poppins',
        marginTop: '5px',
    },
};

export default Contact;
